SET NAMES 'UTF8';
SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS `ZipCodes` CASCADE;
CREATE TABLE `ZipCodes` (
	`zip` varchar(255),
	`CTY` varchar(255),
	`COUNTY` varchar(255),
	`USDIST` float,
	`SABES` varchar(255),
	`SDA` float,
	`OFFICIAL_TOWN_CITY` varchar(255),
	`CITY_TOWN` varchar(255),
	`ST_REP_DIS` varchar(255),
	`STATE_SEN` varchar(255),
	`DATE_EFF` datetime,
	`DATE_EXP` varchar(255),
	`ZIP_CODE_ID` float,
	`POPULATION` float,
	`HIGH_UNEMPLOYMENT` varchar(255),
	`KOC` varchar(255),
	`DOEREG` varchar(255),
	`UNEMPL_RATE` float,
	`RURAL_URBAN` varchar(255),
	`U_RATE` varchar(255),
	`POPULATION_DEN` varchar(255),
	INDEX `zip` (`zip` ASC),
	INDEX `ZIP_CODE_ID` (`ZIP_CODE_ID` ASC)
);



SET FOREIGN_KEY_CHECKS = 1;
